#include <vector>

using namespace std;

class Solution {
public:

    static inline bool isVowel(char c) {
        if (c=='a' ||
            c=='e' ||
            c=='u' ||
            c=='i' ||
            c=='o')
            return true;
        return false;
    }

    vector<int> vowelStrings(vector<string>& words, vector<vector<int>>& queries) {
        int query_length = queries.size();
        int words_length = words.size();
        int saved_res[words_length];
        int ret[query_length];
        for (int i = 0; i < query_length; ++i) ret[i] = 0;
        for (int i = 0; i < words_length; ++i) saved_res[i] = -1;

        for (int i = 0; i < query_length; ++i) {
            printf("querying query %d\n", i);
            int start = queries[i][0];
            int end = queries[i][1];
            for (int j = start; j <= end; ++j) {
                string word = words[j];
                int length_word = word.size();
                if (saved_res[j]==-1) {
                    if (isVowel(word[0]) && isVowel(word[length_word-1])) {
                        ret[i]++;
                        saved_res[j]=1;
                    } else {
                        saved_res[j]=0;
                    }
                } else if (saved_res[j]==1) {
                    ret[i]++;
                }
            }
        }
        return vector<int>(ret, ret+query_length);
    }
};

